import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

export default function NavBar() {
    return (
        <div>
            <p>NavBar component</p>
            <Router>
                <Routes>
                    <Route exact to="/contact">Contact>

                    </Route>
                </Routes>
            </Router>
        </div>
    );
}
